import React, { Component } from 'react';

export default class Api extends Component {
    constructor(props) {
        super(props);
        this.url = 'https://randomuser.me/api/?results=10';
    }

    async getData(url) {
        fetch(url)
            .then(data => data.json())
            .then(res => {
                return res;
            })
            .catch(error => console.log(error));
    }

    render() {
        return <p></p>;
    }
}
